import { Component } from '@angular/core';

@Component({
  selector: 'app-bienvenido',
  templateUrl: './bienvenido.component.html',
  styleUrls: ['./bienvenido.component.css']
})
export class BienvenidoComponent {

}
<nav>
    <ul class="btn btn-primary">

       <a class="btn btn-primary" routerLink="/servicios">Servicios</a>
       <a class="btn btn-primary" routerLink="/acceso">Acceso</a>


    </ul>
</nav>

<div class="w-100 " >
    <img src="https://clinicaimif.com/wp-content/uploads/2019/06/rehab.jpg" alt="">
</div>
